import React, { Component }  from 'react';
import { Table } from 'react';
import logo from './logo.svg';
import './App.css';

class Child extends Component {
  render() {
    let {name} = this.props;
    return <li>{name}</li>
  }
}

class Parent extends Component {
  render() {
    return (
        <div>
          <h1>{"Group 1"}</h1>
          <ul>{this.props.hits.map(item => {
                return <Child key={item.id} />
              })}
          </ul>
        </div>
    );
  }
}

class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
        hits: {},
      };
    }
    componentDidMount() {
      fetch('/nba',  {
        headers: {
          "Access-Control-Allow-Origin": "*"
        }
      })
        .then(response => response.json())
        .then(response => {
          console.log(response)
          this.setState({hits: response})
      });
      }


    render() {
      const items =  this.state.hits.map(function(item){
        return <li> {item} </li>;
      });
      return (
        <div>
          <h1>My "To Do" List:</h1>
          <ul>
            {items}
          </ul>
        </div>
      );

    }

  }
export default App;

